        <script src="https://cdn.jsdelivr.net/npm/handlebars@latest/dist/handlebars.js"></script>
        <script id="templateHB" type="text/x-handlebars-template">
            {{#each camisetas}}
            <article class="IS_product_item">
                <div class="img_container" >
                    <a href="{{this.link}} " title="{{this.title}}">
                        <img src="{{this.image}}" alt="{{this.description}} ">
                    </a>
                </div>
                <div class="item_container" >
                    <h3 class="item_header">
                        <a href="{{this.link}} ">{{this.title}}</a>
                    </h3>
                    <strong class="item_price">
                        <span class="price regular old_price">{{this.price}}</span>
                        {{#if sale}}
                        <span class="new_price">{{this.sale}}</span>
                        <p class="more_info">{{this.moreInfo}} <a class="promo_links" href="{{promoLink}}">promos</a></p>
                        {{/if}}
                    </strong>
                </div>
            </article>
            {{/each}}
        </script>
